import React, { Component } from "react";
import { ButtonWrap } from "../components/Buttons";

class AddAgent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      showAddAgent: false
    };
  }
  toggleAddAgent = () => {
    this.setState({ showAddAgent: true });
    this.setState({ overlay: true });
  };
  render() {
    return (
      <div
        className={
          this.state.showAddAgent
            ? "show Wrapper fixedCenter p-5"
            : "hide Wrapper fixedCenter p-5"
        }
      >
        {this.props.close}
        <div className="table-responsive text-right">
          <div className="text-left">
            <h6>Add User</h6>
          </div>
          <input
            type="text"
            placeholder="Project ID"
            className="form-control mb-2"
          />
          <input
            type="text"
            placeholder="User ID"
            className="form-control mb-2"
          />
          <input
            type="text"
            placeholder="Permission Type"
            className="form-control mb-2"
          />
          <ButtonWrap save>Submit</ButtonWrap>
        </div>
      </div>
    );
  }
}

export default AddAgent;
